import logo from './logo.svg';
import './App.css';
import React from "react";
import Footer from "./Footer"
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Switch, useHistory } from 'react-router-dom';
import LoginActv from "./LoginActv";
import GidaiList from "./GidaiList";
import Logout from "./Logout";
import Automobiliai from "./Lists/Automobiliai";
import Mechanikai from "./Lists/Mechanikai";
import './App.css'
import RegisterActv from "./RegisterActv";
import Mechanikas from "./Mechanikas";

function App() {
  const token =  localStorage.getItem('auth_token')
    const username =  localStorage.getItem('user_name')
    const usermail =  localStorage.getItem('user_email')
    const userrole =  localStorage.getItem('user_role')
    return(
        <div className="mainDiv">
            <Router>
                <Switch>
                <Route exact path="/">
                    <LoginActv />
                </Route>
                    <Route exact path="/prisijungimas">
                    <LoginActv />
                </Route>
                    <Route exact path="/registracija">
                    <RegisterActv/>
                </Route>
                <Route exact path="/gidai">
                    <GidaiList/>
                </Route>
                <Route exact path="/atsijungimas">
                    <Logout/>
                </Route>
                <Route exact path="/automobiliai">
                    <Automobiliai/>
                </Route>
                <Route exact path="/mechanikai">
                    <Mechanikai/>
                </Route>
                <Route path="/mechanikai/:id" component={Mechanikas}>
                    <Mechanikas/>
                </Route>
                </Switch>
             </Router>
             <Footer/>
             </div>
  );
}

export default App;
